let calculateTest = {
    /**
     * 整数加法运算函数
     * @param {int} num1 加数
     * @param {int} num2 加数
     * @return {int} 和  
     */
    add(num1,num2){
        return num1+num2;
    },
    /**
     * 整数减法运算函数
     * @param {int} num1 被减数
     * @param {int} num2 减数
     * @return {int} 差
     */
     sub(num1,num2){
        return num1-num2;
    }
}

module.exports =  calculateTest;